import React, { Component } from "react";
import Table from "./components/table";
import Checkbox from "./components/checkbox";

export default class custom extends Component {
  constructor(props){
    super(props)
    this.getTable = this.getTable.bind(this);
  }
  getTable(){
    var w = "&W=" + Checkbox.getState();
    //var l = "&L=" + this.state.L;
    //var m = "&MIN=" + this.state.MIN;
    //var fg = "&FG_PCT=" + this.state.FG_PCT;
    //var fg3 = "&FG3_PCT=" + this.state.FG3_PCT;
    //var ft = "&FT_PCT=" + this.state.FT_PCT;
    //var pts = "&PTS=" + this.state.PTS;
    //var reb = "&REB=" + this.state.REB;
    //var ast = "&AST=" + this.state.AST;
    //var stl = "&STL=" + this.state.STL;
    //var blk = "&BLK=" + this.state.BLK;
    //var tov = "&TOV=" + this.state.TOV;
    //var query = "localhost:5002/rankplayers?mode=custom" + w + l + m + fg + fg3 + ft + pts + reb + ast + stl + blk + tov;
    //console.log(query);
  }
  render() {
    return (
      <div className="text-center text-secondary" style={{ marginTop: "10%" }}>
        <h6>Please select which categories you would like to be included</h6>
        <div className="text-left" style={{ marginLeft: "25%" }}>
          <Checkbox text='Wins' id='W'></Checkbox>
          <Checkbox text='Losses'></Checkbox>
          <Checkbox text='Minutes'></Checkbox>
          <Checkbox text='Field Goal %'></Checkbox>
          <Checkbox text='3 Point %'></Checkbox>
          <Checkbox text='Free Throw %'></Checkbox>
          <Checkbox text='Points'></Checkbox>
          <Checkbox text='Rebounds'></Checkbox>
          <Checkbox text='Assists'></Checkbox>
          <Checkbox text='Steals'></Checkbox>
          <Checkbox text='Blocks'></Checkbox>
          <Checkbox text='Turnovers'></Checkbox>
        </div>
        <div style={{ marginTop: "20px" }}>
          <button className="btn btn-primary btn-sm" onClick={this.getTable}> Submit </button>
        </div>
      </div>
    );
  }
}
